from cptu_classification_models_2d import model_defs as sbts
from figure_formatting import markers, colors


def add_data( ax, materials, markersize = 10, markeralpha = .35, markerz = 0, clip_on=True ):
    for matr in materials:
        x, y, label, m, c, logx, logy, xlim, ylim = matr

        ax.scatter(
            x, 
            y, 
            label=label,
            s=markersize,
            marker=m,
            fc=c,
            alpha=markeralpha, # no fading
            zorder=markerz,
            clip_on=clip_on
        )


def get_data( matr, variable ):
    var_key = { # dataset var name format from meanCPT project
        'Bq': 'BQ', 'qt': 'QT', 'Rf': 'RF', 'Qt': 'QQT',
        'Fr': 'FR', 'fs': 'FS', 'qe': 'QE', 'du_n': 'DUN',}
    return matr[var_key[variable]]


def get_chart_data( k, study):
    chart_name = list(sbts.keys())[k]
    x_var, logx_txt = sbts[chart_name]['desc']['x_axis']
    y_var, logy_txt = sbts[chart_name]['desc']['y_axis']
    logx = logx_txt.lower() == 'log'
    logy = logy_txt.lower() == 'log'
    xlim = sbts[chart_name]['desc']['x_bounds']
    ylim = sbts[chart_name]['desc']['y_bounds']

    matrs = []

    for matr in study:
        c = colors[3] if matr['name']=='Sensitive' or 'Quick' in matr['name'] else colors[4]
        m = markers[0] if matr['name']=='Sensitive' or 'Quick' in matr['name'] else markers[1]

        x = get_data( matr, x_var )
        y = get_data ( matr, y_var )

        # grab material label
        label = matr[ 'name' ].replace( 'Quick', 'Quick clay' ).replace( '_','-' ) + ' (' + str( len(x) ) + ')'
        label = label.replace( 'Quick clay', 'Sensitive' ) # not used in this study
        label = label.replace( 'Sensitive', 'Brittle' ) # named sensitive in dataset
        label = label.replace( 'Non-sensitive', 'Non-brittle' ) # Non-sensitive in dataset

        matrs.append( [ x, y, label, m, c, logx, logy, xlim, ylim ] )
    return matrs


